        public virtual string PayTo { get; set; }
        [Parameter("address", "operator", 3)]
        public virtual string Operator { get; set; }
    }

    public partial class TotalAuctionsFunction : TotalAuctionsFunctionBase { }

    [Function("totalAuctions", "uint256")]
